import React from 'react';

const styles={
    h1: {
        // marginTop: '25vh',
        color: 'lightgrey',
        display: 'inline-block',
        fontSize: '30px'
    },
    button: {
        // color: 'grey',
        // padding: '1%',
        backgroundColor: 'inherit',
        // borderColor: 'grey'
         display:"block",
         padding:"0.35em 1.2em",
         border:"0.1em solid lightgrey",
         margin:"0 0.3em 0.3em 0",
         borderRadius:"0.12em",
         boxSizing: "border-box",
         textDecoration:"none",
         fontWeight:"300",
         color:"lightgrey",
         textAlign:"center",
         transition: "all 0.2s",

    },
    htmlstart: {
        color: 'grey',
        fontFamily: "cursive"

    },
    h1start: {
        color: 'grey',
        marginTop: '25vh',
        fontFamily: "cursive",
        marginLeft: '25%'
    },
    h1end: {
        color: 'grey',
        fontFamily: "cursive",
        marginLeft: '25%'
    },
    buttonstart: {
        marginTop: '2vh',
        color: 'grey',
        fontFamily: "cursive",
        marginLeft: '25%'
    }
}
const tags = {
    htmlstart: "<html>",
    bodystart: "<body>",
    h1start: "<h1>",
    htmlend: "</html>",
    bodyend: "</body>",
    h1end: "</h1>",
    buttonstart: "<button>",
    buttonend: "</button>",
}
const Newlanding = () => {

    return(

        <>
        <br></br> 
        <p style={styles.htmlstart}>{tags.htmlstart}</p>       
            <p style={styles.h1start}>{tags.h1start}</p>
            <center> 
            <p className="nameh1">Chase Lipscomb Web Developer</p>
            </center>
            <p style={styles.h1end}>{tags.h1end}</p>
            <p style={styles.buttonstart}>{tags.buttonstart}</p>
            <center> 
            <a href='/Portfolio'><button style={styles.button}
href='/Portfolio'                onMouseOut={({target})=>{
                    target.style.color='lightgrey'
                    target.style.color='lightgrey'
                }}
                onMouseOver={({target})=>{
                    target.style.color='white'
                    target.style.borderColor='white'
                    }}>View Work</button></a>
            </center>
            <p style={styles.h1end}>{tags.buttonend}</p>

        </>

    )
}
export default Newlanding
